import {css} from 'lit-element';

export const style = css`
  :host {
    display: flex;
    flex: auto;
    width: 22%;
    min-width: 150px;
    max-width: 300px;
    border-right: black 2px ridge;
  }
  #navigation-body {
    flex: auto;
  }
`;
